import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Add styles for Navbar if required
import { FaSearch, FaHeart, FaUserCircle, FaShoppingCart } from 'react-icons/fa'; 

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">Nova</div>
      <ul className="nav-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/shop">Shop By</Link></li>
        <li><Link to="/contact">Contact</Link></li>
       <li><Link to="/"><FaSearch className="icon" /></Link></li> 
       <li><Link to="/"><FaHeart className="icon" /></Link></li> 
       <li><Link to="/profil"><FaUserCircle className="icon" /></Link></li> 
       <li><Link to="/cart"><FaShoppingCart className="icon" /></Link></li> 



      </ul>
    </nav>
  );
};

export default Navbar;
